-- openemr.form_odontogram definition
CREATE TABLE `form_odontogram` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `universal` varchar(10) DEFAULT NULL COMMENT 'Universal numbers and letters',
  `fdi` varchar(10) DEFAULT NULL COMMENT 'FDI Numbers',
  `palmer` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Palmer Symbols',
  `dentition_type` enum('Infant','Adult') DEFAULT NULL COMMENT 'Adult or Infant',
  `name` varchar(50) DEFAULT NULL COMMENT 'Name of Tooth',
  `part` enum('Complete','Vertical','Distal','Mesial','Lingual','Buccal','Incisal','Occlusal') DEFAULT NULL COMMENT 'Part of tooth',
  `arc` enum('Maxillary','Mandibular') DEFAULT NULL COMMENT 'Maxillary or Mandubular',
  `style` text DEFAULT NULL COMMENT 'Original Style',
  `side` enum('Left','Right') DEFAULT NULL COMMENT 'Left or Right',
  `tooth_id` varchar(60) DEFAULT NULL COMMENT 'tooth id of odontogram.svg',
  `d` text DEFAULT NULL COMMENT 'Not used. For future expansions.',
  `width` float DEFAULT NULL COMMENT 'Not used. For future expansions.',
  `height` float DEFAULT NULL COMMENT 'Not used. For future expansions.',
  `x` float DEFAULT NULL COMMENT 'Not used. For future expansions.',
  `y` float DEFAULT NULL COMMENT 'Not used. For future expansions.',
  `sodipodi` varchar(100) DEFAULT NULL COMMENT 'Not used. For future expansions.',
  `svg_type` varchar(20) DEFAULT NULL COMMENT 'Not used. For future expansions.',
  PRIMARY KEY (`id`),
  KEY `odontogram_id_IDX` (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=345 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

-- openemr.form_odontogram_history definition
CREATE TABLE `form_odontogram_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `date` datetime DEFAULT NULL,
  `pid` int(11) DEFAULT NULL COMMENT 'Patient Id',
  `encounter` int(11) DEFAULT NULL COMMENT 'Encounter number',
  `user` varchar(100) DEFAULT NULL COMMENT 'Username',
  `groupname` varchar(100) DEFAULT NULL COMMENT 'Group Name',
  `authorized` tinyint(4) DEFAULT NULL,
  `activity` tinyint(4) DEFAULT 1,
  `odontogram_id` int(11) DEFAULT NULL COMMENT 'id of form_odontogram',
  `intervention_type` enum('Diagnosis','Issue','Procedure') DEFAULT NULL,
  `tooth_id` varchar(100) DEFAULT NULL COMMENT 'tooth_id of form_odontogram of odontogram.svg',
  `option_id` varchar(100) DEFAULT NULL COMMENT 'option_id of list_options',
  `code` varchar(100) DEFAULT NULL COMMENT 'code of list_options',
  `notes` text DEFAULT NULL COMMENT 'medical notes',
  `svg_style` varchar(100) DEFAULT NULL COMMENT 'note of list_options (style)',
  `draw_d` text DEFAULT NULL COMMENT 'Not used. For future expansions.',
  `draw_style` varchar(100) DEFAULT NULL COMMENT 'Not used. For future expansions.',
  PRIMARY KEY (`id`),
  KEY `odontogram_id` (`odontogram_id`),
  KEY `form_odontogram_history_odontogram_id_IDX` (`odontogram_id`) USING BTREE,
  KEY `idx_odontogram_history` (`pid`,`activity`,`date`,`intervention_type`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

-- Default number system per user
ALTER TABLE users
ADD COLUMN odontogram_preference ENUM('Universal','FDI','Palmer') DEFAULT NULL;

